export default function Mostlypurchased() {
  return (
    <Box sx={{ display: 'flex', flexDirection: 'row', gap: '10px' }}>
      {cardsData.map((item, index) => (
        <Card key={index} sx={{ width: '250px' }} variant="outlined">
          <CardContent>
            <img
              src={item.imageSrc}
              alt="category"
              style={{ width: "216px", height: "275px", borderRadius: "20px" }}
            />
            <p style={{ width: "236px", height: "25px", fontFamily: 'Quicksand', fontStyle: 'normal', fontWeight: 500, fontSize: "20px", lineHeight: "25px", color: '#000000' }}>
              {item.title}
